import "./record.scss"
import OneRecord from "./oneRecord";
const Record = () => {
    return (
        <div className="container_main">
            <div className="container_flex">
                <div className="container_rec">
                    <OneRecord/>
                    <OneRecord/>
                    <OneRecord/>
                    <OneRecord/>
                    <OneRecord/>
                    <OneRecord/>
                    <OneRecord/>
                    <OneRecord/>
                </div>
            </div>
        </div>
    );
};

export default Record;
